import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  useRouteMatch,
} from "react-router-dom";

import Login from './components/pages/Login';

const App = () => {
  return (

    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <Login />
        </Route>
        <Route path="/users">
          <Login />
        </Route>
      </Switch>
    </BrowserRouter>

  )
}

export default App
